import React, { useState, useEffect } from 'react';
import './css/home.css'

// Images
import sliderBg from '../image/slider_bg.jpg'; // Adjusted path as per common practice
import  scopelogo from '../image/scope-india-logo-home-page (2).png'
import snowpark from '../image/snowpark-home-slide-decoration-bottomm.png';
import star from '../image/5star.png';


import aws from '../image/scope-india-aws-certification-course-(1).jpg';
import cloud from '../image/scope-india-azure-certification-course.jpg';
import digitalmarketing from '../image/scope-india-digital-marketing-course.jpg';
import dotnet from '../image/scope-india-dotnet-core-full-stack-course.jpg';
import flutter from '../image/scope-india-flutter-fullstack-course.jpg';
import java from '../image/scope-india-java-full-stack-course (1).jpg';
import mern from '../image/scope-india-mean-mern-stack-course.jpg';
import network from '../image/scope-india-network-server-administration-course (1).jpg';
import php from '../image/scope-india-php-full-stack-course (1).jpg';
import python from '../image/scope-india-python-full-stack-course (1).jpg';
import software from '../image/scope-india-software-testing-manual-automation-course.jpg';
import software2 from '../image/scope-india-software-testing-manual-automation-course.jpg';

// Components
import ContactForm from './Contactform';
import Homenavigate from './Homenavigate';
import Footer from './Footer';

const Home = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const images = [ aws, cloud, digitalmarketing, dotnet, flutter,  java, mern, network, php, python, software, software2];

  useEffect(() => {
    const timer = setTimeout(() => {
      setCurrentImage((currentImage + 3) % images.length);
    }, 4000);

    return () => clearTimeout(timer); // Cleanup on component unmount
  }, [currentImage]);

  return (
    <>
    <div id='homepage' >
      {/* Hero Section */}
      <div >
        <img src={sliderBg} alt="background"  />
        <div >
          <img src={scopelogo} alt="logo" />
        </div>
        <div >
          {images.slice(currentImage, currentImage + 3).map((image, index) => (
            <div key={index} >
              <img src={image} alt={`Slide ${index}`} />
            </div>
          ))}
        </div>
        <img src={snowpark} alt="Snowpark Decoration"  />
      </div>

      {/* Contact Form */}
      <div >
        <div >
          <ContactForm />
        </div>
      </div>

      {/* Testimonial Section */}
      <div >
        <div>
          <img src={star} alt="5star" />
          <p >Google 4.9 * Rated Institute</p>
          <h1 >SCOPE INDIA, your career partner!</h1>
          <h2 >One of the best Training Destination for Software, Networking and Cloud Computing courses in India with 17 years of Industrial experience.</h2>
          <p >Software, Networking, and Cloud Professional Education Centre in Kerala from Suffix E Solutions with WORKING PROFESSIONALS oriented on-the-job TRAINING model. SCOPE INDIA provides courses for ,<span style={{ fontWeight: 'bold' }}> Software Programming </span>  in Python (Data Science | Artificial Intelligence | Machine Learning | Deep Learning, Data Analytics), Java, PHP, .Net, <span style={{ fontWeight: 'bold' }}>Software Testing </span>Manual and Automation,  <span style={{ fontWeight: 'bold' }}>Cloud Computing </span> (AWS | Azure),<span style={{ fontWeight: 'bold' }}> Server Administration </span>  (MCSE | RHCE), <span style={{ fontWeight: 'bold' }}> Networking</span>  (CCNA),  <span style={{ fontWeight: 'bold' }}>  Mobile App Development </span> in Flutter, and   <span style={{ fontWeight: 'bold' }}> Digital Marketing. </span> Training 
     with 100% Trusted Job Based Internship Model. SCOPE INDIA has a Strong Placement Cell that provides jobs to thousands of students every
     year. We assure you, you won't regret it after training from SCOPE INDIA!  <br/> <br/> </p>
        </div>
      </div>

      {/* Navigation */}
      <div >
        <div >
          <Homenavigate />
        </div>
      </div>

      {/* Footer */}
      <div >
        <div >
          <Footer />
        </div>
      </div>
      </div>
    </>
  );
};

export default Home;
